import calendaricon from "../images/calendar_icon.png";

function SearchFilter(props) {

    function handleSubmit(event) {
        event.preventDefault();
        console.log(props.destination, props.checkInDate, props.checkOutDate, props.guests);
    }

    return(
        <div className="SearchFilter">
            <img src={calendaricon}/>
            <form onSubmit={handleSubmit}>
                <label>Destination<br></br> <input type="text" name="destination" value={props.destination} onChange={props.changeDestination}/></label>
                <label>Check in<br></br> <input type="date" name="checkInDate" value={props.checkInDate} onChange={props.checkInDate}/></label>
                <label>Check out<br></br> <input type="date" name="checkOutDate" value={props.checkOutDate} onChange={(e) => setCheckOutDate(e.target.value)}/></label>
                <label>Guests<br></br> <input type="number" name="guests" value={props.guests} onChange={(e) => setGuests(e.target.value)}/></label>
                <label>Check availability<br></br> <input type="submit"/></label>
            </form>
        </div>
    )
}

export default SearchFilter;
// Exporterar komponenten som "SearchFilter".
